            __builder.AddMarkupContent(5, "<section id=\"motor\">\r\n    \r\n    <h3>Patentierte Kraft: der Motorraum </h3>\r\n    Mit Ölwannen, Motorabdeckungen, Luftfiltern, Ladeluftverteilerleitungen, Resonatoren oder Zylinderkopfhauben höchster Qualität hat sich Montaplast einen Namen gemacht.<br>\r\n    Wer \"Montaplast\" hört, denkt oft aber erst einmal an ein ganz spezielles Produkt: das Ansaugrohr.<br>\r\n    Der Grund: Viele der zahlreichen Patente, die Montaplast besitzt, sind mit dem Ansaugbereich verbunden.<br>\r\n    Weil wir Kunststoffen hier zum Durchbruch verholfen haben,<br>\r\n    halten moderne Ansaugrohre bei geringerem Volumen und Gewicht höheren Hitze- und Druckbelastungen stand und erfüllen immer mehr Funktionen.<br>\r\n\r\n\r\n    <img src=\"https://www.montaplast.com/fileadmin/_processed_/csm_img_0318_e64beb2d11.jpg\" id=\"kraft\" alt=\"...\">\r\n    <img src=\"https://www.montaplast.com/fileadmin/_processed_/csm_img_9854_b7ed4ad9fd.jpg\" id=\"kraft\" alt=\"...\">\r\n    <img src=\"https://www.montaplast.com/fileadmin/_processed_/csm_img_9953_wide_f1f47aed1f.jpg\" id=\"kraft\" alt=\"...\"><br>\r\n\r\n    <img src=\"https://www.montaplast.com/fileadmin/_processed_/csm_visual_motorraum_c7c4a48645.jpg\" class=\"img-fluid\" alt=\"Unsere Komponenten im Motorraum\">\r\n\r\n\r\n    <h3>Scharfe Optik: das Interieur</h3>\r\n    Edel und harmonisch soll er wirken, der Innenraum eines Fahrzeugs.<br>\r\n    An Säulen- und Kofferraumverkleidungen, Overhead-Konsolen, Lautsprechergitter,<br>\r\n    Ladekantenabdeckungen oder Entlüftungsgitter werden hohe optische Anforderungen gestellt. <br>\r\n    Auch nach fünf oder zehn Jahren sollte das Ambiente noch stimmen, und leise muss es sein. <br>\r\n    Wir wissen das: Die von uns hinterspritzten Textilien, Leder und Folien bewahren dank hochwertiger Verarbeitung ihr Erscheinungsbild. <br>\r\n    Speziell entwickelte Klebstoffsysteme sorgen für eine schadstoffarme Atmosphäre, und was sich hinter den Kulissen abspielt,<br>\r\n    ist vom Komfort gewohnten Passagier kaum noch zu ahnen. Nur ein Hinweis:<br>\r\n    Energieabsorber und Luftführungen integriert Montaplast selbstverständlich in die Verkleidung.<br>\r\n    \r\n    <img src=\"https://www.montaplast.com/fileadmin/_processed_/csm_img_0169_104b14ec20.jpg\" id=\"kraft\" alt=\"...\">\r\n    <img src=\"https://www.montaplast.com/fileadmin/_processed_/csm_img_0120_b66f0eb673.jpg\" id=\"kraft\" alt=\"...\">\r\n    <img src=\"https://www.montaplast.com/fileadmin/_processed_/csm_img_0592_0199_9137ab74d8.jpg\" id=\"kraft\" alt=\"...\">\r\n    <br>\r\n\r\n    <img src=\"https://www.montaplast.com/fileadmin/_processed_/csm_visual_interieur_01_2d8962a8f2.jpg\" class=\"img-fluid\" alt=\"Unsere Komponenten im Innenraum des Fahrzeugs\">\r\n\r\n    <h3>Starke Außenwirkung: das Exterieur</h3>\r\n    Auch als Lieferant für Exterieur-Systeme ist Montaplast ein fester Begriff -<br>\r\n    und das nicht erst seit dem Bau unserer aktuellsten, zukunftsweisenden Lackieranlage.<br>\r\n    Die Module, die Montaplast fertigt, werden seit Jahren immer größer und komplexer:<br>\r\n    lackierte Stoßfänger-, Front- und Hecksysteme, Kotflügel, Spoiler, Säulen- und Längsträgerverkleidungen,<br>\r\n    Seitenschutz- und Griffleisten, Wasserabscheidungen, verchromte Kühlerschutz- und Lufteinlassgitter ... <br>\r\n    Erstaunlich, wie viel Montaplast heute in einem einzigen Auto stecken kann - schon rein äußerlich.<br>\r\n\r\n   <div id=\"teile\">\r\n    <img src=\"https://www.montaplast.com/fileadmin/_processed_/csm_img_0304_085a5dbff7.jpg\" id=\"ex\" alt=\"...\">\r\n    <img src=\"https://www.montaplast.com/fileadmin/_processed_/csm_img_0450_345159b564.jpg\" id=\"ex\" alt=\"...\">\r\n    <img src=\"https://www.montaplast.com/fileadmin/_processed_/csm_img_0156_b3d9220f5e.jpg\" id=\"ex\" alt=\"...\"><br>\r\n\r\n    <img src=\"https://www.montaplast.com/fileadmin/_processed_/csm_img_9950_8cf6b58f7f.jpg\" id=\"ex\" alt=\"...\">\r\n    <img src=\"https: